import CreateWishListForm from "../CreateReadForm";

const WishList = ({ user }) => {

      return (
          <div>
            <CreateReadForm />
                {!user ? <h2>Not logged in</h2> : 
                    user.wishList.map((book) => {
                        return (
                            <div>
                                <h2>{book.title}</h2>
                                <h3>{book.author}</h3>
                            </div>
                        )
                    })

                }    
            </div>
      )
}

export default WishList;
